  const amount=useSelector(state=>state.account.amount);
  const bonus=useSelector(state=>state.bonus.price);
  const account=useSelector(state=>state.account);


  return (
    <div className="App">
      <h4>App</h4>
      <h3>Current Amount : {amount}</h3>
      <h3>Total Bonus :{bonus} </h3>

      <Account ></Account>
      <Bonus ></Bonus>
    </div>
  );
}

export default App;
